	private int ObterVersaoBaseDados()
	{
		StringBuilder stringBuilder = new StringBuilder();
		stringBuilder.Append("select cd_versao");
		stringBuilder.Append($" from [{BaseDadosERP.NomeServidor}].[{BaseDadosERP.NomeBaseDados}].[Sistema].[Versao] ");
		stringBuilder.Append("Where [cd_codigo_versao] = 1");
		int result = 0;
		try
		{
			DataRow dataRow = BaseDadosERP.ObterDataRow(stringBuilder.ToString());
			if (dataRow != null)
			{
				result = BaseDadosERP.ObterDbValor<int>(dataRow["cd_versao"]);
			}
		}
		catch
		{
			try
			{
				stringBuilder = new StringBuilder();
				stringBuilder.Append("IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[Sistema].[Versao]') AND type in (N'U')) ");
				stringBuilder.Append("BEGIN ");
				stringBuilder.Append("CREATE TABLE [Sistema].[Versao](\r\n                \t[cd_codigo_versao] [int] NOT NULL,\r\n                \t[cd_versao] [int] NOT NULL\r\n                ) ON [PRIMARY] ");
				stringBuilder.Append("END; ");
				BaseDadosERP.AtualizarBD(stringBuilder.ToString());
				stringBuilder = new StringBuilder();
				stringBuilder.Append("INSERT INTO [Sistema].[Versao] ([cd_codigo_versao],[cd_versao]) VALUES (1,1) ");
				BaseDadosERP.AtualizarBD(stringBuilder.ToString());
			}
			catch
			{
			}
		}
		return result;
	}

